import React from 'react';
import { Box, Typography, Divider } from '@mui/material';

interface DirectionItem {
  periodo: string;
  presidente: string;
  vice: string;
  tesoureiro: string;
  diretorTecnico: string;
  diretorSocial: string;
}

const directionList: DirectionItem[] = [
  {
    periodo: '2024/2025',
    presidente: 'Gilberto Raposo',
    vice: 'Cássio Sarti',
    tesoureiro: 'Cláudio Lellis',
    diretorTecnico: 'Gustavo Borges',
    diretorSocial: 'Gustavo Garcia'
  },
  {
    periodo: '2021/2023',
    presidente: 'Cristiano Ricci',
    vice: 'Juliano de Vito',
    tesoureiro: 'Fernando C. Filho',
    diretorTecnico: 'Walter Moraes',
    diretorSocial: 'Leonardo Santos'
  },
  {
    periodo: '2020/2022',
    presidente: 'Renan Braz',
    vice: 'Rinaldo Marcondes',
    tesoureiro: 'Ricardo Galo',
    diretorTecnico: 'Cristiano Ricci',
    diretorSocial: 'Walter Moraes'
  }
];

export const Direction: React.FC = () => {
  return (
    <Box maxWidth={700} mx="auto" mt={5} mb={10} color="#0d3b66" px={2}>
      {directionList.map(
        ({
          periodo,
          presidente,
          vice,
          tesoureiro,
          diretorTecnico,
          diretorSocial
        }) => (
          <Box key={periodo} mb={4}>
            <Typography variant="h5" fontWeight="bold" mb={1}>
              {periodo}
            </Typography>
            <Typography>Presidente: {presidente}</Typography>
            <Typography>Vice Presidente: {vice}</Typography>
            <Typography>Tesoureiro: {tesoureiro}</Typography>
            <Typography>Diretor Técnico: {diretorTecnico}</Typography>
            <Typography>Diretor Social: {diretorSocial}</Typography>
            <Divider sx={{ mt: 2 }} />
          </Box>
        )
      )}
    </Box>
  );
};
